    const handleTileClick = (skill) => {
        onNavigate('home');
        onSelectSkill(skill);
    };

    const skills = [
        { name: 'Active Listening', icon: 'üëÇ' },
        { name: 'Ambiguity Tolerance', icon: '‚ùì' },
        { name: 'Conflict Avoidance', icon: '‚ÜîÔ∏è' },
